import React from 'react'
import $ from 'jquery';
import 'datatables.net';

import { Component } from 'react';

class FlowerTable extends Component {

    componentDidMount() {
        $('#myTable').DataTable();



        
      }
      
    render() {
        const tableData = this.state.data;
        const tableRows = tableData.map((row, index) => (
          <tr key={index}>
            <td>{row.name}</td>
            <td>{row.description}</td>
            <td>{row.price}</td>
            <td>{row.quantity}</td>
            <td>{row.url}</td>
            <td>{row.categoryid}</td>
            <td>{row.flowerid}</td>

          </tr>
        ));
      
        return (
          <table id="myTable">
            <thead>
              <tr>
                <th>Naziv</th>
                <th>Opis</th>
                <th>Cena</th>
                <th>Kolicina</th>
                <th>Slika</th>
                <th>Kategorija</th>
                <th>Cvet</th>
                {/* Add more headers as needed */}
              </tr>
            </thead>
            <tbody>
              {tableRows}
            </tbody>
          </table>
        );
      }
      

}

export default FlowerTable
